import React from 'react';

type TodolistType = {
    title:string;
    task:Array<ArrayTodolistType>
}

type ArrayTodolistType = {
    id:string;
    title:string;
    isDone:boolean;
}




export const Todolist = (props:TodolistType) => {
    return (
        <div>

     <h3>{props.title}</h3>
            <input/>
            <button>Add</button>
            <ul>
                {props.task.map((el)=>{
                    return (
                        <li key={el.id}>
                            {el.title}
                            <input type={"checkbox"} checked={el.isDone}/>
                        </li>
                    )
                })}
            </ul>
            <button>All</button>
            <button>Active</button>
            <button>Completed</button>
        </div>
    );
};
